class Resources
{
    // Função para verificar se um número é primo
    private function isPrime($number): bool
    {
        if ($number <= 1) {
            return false;
        }
        for ($i = 2; $i * $i <= $number; $i++) {
            if ($number % $i == 0) {
                return false;
            }
        }
        return true;
    }

    // Função para gerar um número primo maior que 100 e que não tenha sido utilizado antes
    private function generateUniquePrime($usedPrimes): int
    {
        $number = 101; // Comece com o primeiro número primo maior que 100
        while (true) {
            if (!in_array($number, $usedPrimes) && $this->isPrime($number)) {
                return $number;
            }
            $number++;
        }
    }

    // String de entrada
    public function generate(string $entrada): string
    {
        $usedPrimes = []; // Array para manter o controle dos números primos usados
        $outputString = ""; // String de saída

        for ($i = 0; $i < strlen($entrada); $i++) {
            $char = $entrada[$i];
            // Verificar se é uma vogal
            if (in_array(strtolower($char), array('a', 'e', 'i', 'o', 'u'))) {
                $char = chr(63 + date('s')); // Substituir por uma letra minúscula aleatória
            } elseif (in_array($char, array('B', 'D'))) {
                // Verificar se é "B" ou "D"
                $prime = $this->generateUniquePrime($usedPrimes);
                $usedPrimes[] = $prime;
                $char = strval($prime); // Substituir por um número primo maior que 100
            } elseif (is_numeric($char)) {
                // Verificar se é um número
                $char = date('s');
            }

            $outputString .= $char;
        }
        return $outputString;
    }

